(403,	410,	'shows',	'1',	'{\"id\":\"1\",\"created_on\":\"2020-08-13 16:18:11\",\"title\":\"Un nouveau d\\u00e9part\",\"slug\":\"un_nouveau_depart\",\"release_date\":\"2015-07-13\",\"picture\":\"2\",\"note\":\"Dehors, l\\u2019orage gronde.\\nMarion & Pierre ne s\\u2019aiment plus dans un vieux film fran\\u00e7ais. \\/Les souvenirs de Sabine Pature se m\\u00e9langent\\nFrouky reprend Lucienne Delyle et r\\u00eave de vous.\\nAnne Laplantine + La France : une histoire de guerre & d\\u2019Atlantide.\\nDamien se fout de la gueule des froggys : humidit\\u00e9 toujours et canons au loin.\\nLes oignons font venir les larmes, c\\u2019est connu. Alors tout le monde pleure : une japonaise pendant que Yann Tomita joue du Chopin autant que la voisine\\nde Salem que le groupe avait enregistr\\u00e9 une apr\\u00e8s-midi .\\nPauvre petite fille : bien que d\\u00e9j\\u00e0 d\\u00e9goulinante de richesse, elle r\\u00eave de bijoux, de boite de nuits et de marques de luxe poisseuse.\\nUn synth\\u00e9 de Kumi Solo + des percussions d\\u2019Higelin et Areski.\\nVoulez-vous m\\u2019\\u00e9pousez demande Jean-Pierre Leaud.\\nUn accident de voiture nous ram\\u00e8ne \\u00e0 la pr\\u00e9histoire survol\\u00e9 par des cuivres en plastique de S\\u00e9bastien Tellier. Finalement, c\\u2019\\u00e9tait le futur.\\nLa pluie continue de tomber.\\nUn braquage rat\\u00e9 sur une musique de Martin Wheelerw.\\nUn conseil de John Love par Dominique A.\\nS\\u00e9rie Noire\\/ This Mortal Coil\\nArnaud Des Palli\\u00e8res parle d\\u2019un bel endroit.\\nR\\u00eavez, r\\u00eavez, puisque r\\u00eavez vous plait\\/Moi je ferais mon r\\u00eave\\/ lorsque je reviendrais chantait la s\\u0153ur de Klement alors jeune enfant. Retrouvant la cassette enregistr\\u00e9e bien des ann\\u00e9es plus tard, le musicien d\\u00e9cida d\\u2019accompagner au synth\\u00e9 cette bande-fant\\u00f4me (elle chante un morceau de Jean Naty-Boyer).\\nJean-S\\u00e9bastien Bach, puis un crescendo de Sebastian, et la conclusion de Mandels