 something like that, personal interpretations accepted. Bon app\\u00e9tit!\",\"tracks\":\"00:00:09 Messer F\\u00fcr Frau M\\u00fcller Mini Bikini\\n00:00:50 Mouse On Mars Monks No Time\\n00:06:12 Buffalo Daughter Great Five Lakes (+ NYC Sub)\\n00:11:19 Max Tundra Orphaned (+ JFK)\\n00:15:31 Angie Reed Dancing Tarantella To A Machine Gun\\n00:17:00 Norman Bambi Psychotic Interstellar Catastrophe\\n00:20:27 Klaten La Marche Des Glumoks (+ JFK)\\n00:25:27 Laurend Bousfiel Cascading Retail Spaces \\/ No More Worlds Like This, No More Days Like That\\n00:28:20 Okapi And Aldo Kapis Orchestra The Next (+ JFK)\\n00:28:30 The Minty Bye Bye Atirs Ailycec (+ Pirates JFK)\\n00:29:22 Joseph Nothing Red Hop Candy (+ Boarding Cancun)\\n00:33:30 Takako Minekawa Milk Rock\\n00:36:48 Polysics Baby Bias39 :38 Mindless Self Indulgence Frying Pan\\n00:42:20 Alexico Nos\\u00e9 (+ NYC Sub)\\n00:44:42 Messer F\\u00fcr Frau M\\u00fcller Snegovik Pod Gipnozom (+Sub Et JKF Glitches)\\n00:49:25 Matmos Zealous Order Of Candied Knights (+ Kukulk\\u00e1n Echoes)\\n00:51:01 Cornelius Brazil (+JFK Boarding Rio)\"}',	NULL,	NULL,	NULL),
